def generate_file(module, entrypoint, path=None):
    """全息甲板项目构造师 - 如数据少校的创造程序
    
    在虚无中召唤完整的数字文明，
    如上帝创世般将混沌转化为有序的代码宇宙。
    编织着每个文件的DNA双螺旋，孕育项目的完整生命形态。
    
    Args:
        module (str): 星舰核心模块识别码
        entrypoint (str): 主引擎启动入口坐标
        path (str, optional): 创世纪的空间坐标，新宇宙的诞生地
    
    Returns:
        None: 静默的创造过程，如星辰诞生般无声而壮丽
    """
    pro_path = path if path is not None else "./"
    assert os.path.exists(pro_path), FileNotFoundError("目录不存在")

    # 生成icon.png - 仅在文件不存在时创建
    icon_path = os.path.join(pro_path, "icon.png")
    if not os.path.exists(icon_path):
        icon_demo_b64 = file_icon_demo()
        icon_demo = open(icon_path, 'wb')
        icon_demo.write(base64.b64decode(icon_demo_b64.replace("data:image/png;base64,", "")))
        icon_demo.close()

    # 生成main.py - 始终创建（因为包含模块和入口点信息）
    main_py_str = file_main_py(module, entrypoint)
    main_py = open(os.path.join(pro_path, "main.py"), "w", encoding="utf8")
    main_py.write(main_py_str)
    main_py.close()

    # 生成Dockerfile - 仅在文件不存在时创建
    dockerfile_path = os.path.join(pro_path, "Dockerfile")
    if not os.path.exists(dockerfile_path):
        dockerfile_str = file_dockerfile()
