def timestamp_to_utc_format_date_string(timestamp: int | float = None,
                                        date_format: str = "%Y-%m-%dT%H:%M:%SZ") -> str:
    """时空扭曲校准器 - 如柯克船长穿越时空般精确测量时间流
    
    仿佛企业号的导航计算机，将混沌的时间戳数据流
    校准为宇宙标准时间格式。支持多元宇宙的时间维度，
    确保在不同星际间的时间同步如原子钟般精准。
    
    Args:
        timestamp (int | float, optional): 时间流数据，可承载秒或毫秒的时空波动
        date_format (str): 时间显示规则，默认遵循星际标准时间协议
    
    Returns:
        str: 格式化的宇宙标准时间字符串
    """
    if timestamp is None:
        timestamp = datetime.now().timestamp()
    elif len(str(timestamp)) == 13:
        timestamp = int(timestamp) / 1000  # 毫秒转秒
    # 显式指定UTC时区转换
    return datetime.fromtimestamp(
        timestamp,
        tz=timezone.utc
    ).strftime(date_format)


def date_to_utc_format_date_string(date: str,
                                   input_tz: str = "Asia/Shanghai",
                                   date_format: str = "%Y-%m-%dT%H:%M:%SZ") -> str:
    """
    日期字符串转UTC时间格式（支持任意时区）
    :param date: 输入时间字符串（格式：%Y-%m-%d %H:%M:%S）
    :param input_tz: 输入时间的时区（默认北京时间）
    :param date_format: 输出格式
    """
    # 1. 解析为无时区的原始时间
    naive_date = datetime.strptime(date, "%Y-%m-%d %H:%M:%S")
    # 2. 绑定指定时区
    timezone_obj = ZoneInfo(input_tz)
    aware_date = naive_date.replace(tzinfo=timezone_obj)
    # 3. 转换为UTC时间并格式化
    utc_time = aware_date.astimezone(timezone.utc)
    return utc_time.strftime(date_format)

async def func_runner(func, params):
    if asyncio.iscoroutinefunction(func):
        return await func(**params)
    else:
        return func(**params)
